import './Register.css';
import { useForm } from "react-hook-form";
import { useNavigate } from 'react-router-dom';

function App() {
  const { register, handleSubmit, formState: { errors },  watch } = useForm();
  const password = watch('password');
  const navigate = useNavigate();


  const handleClick = () => {
    navigate('/login'); 
  }

  const onSubmit = async (data) => {
    try {
      const response = await fetch('/api/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(data),
      });

      if (response.ok) {
        navigate('/home');
      } else {
        alert('Error registering user:', response.status);
      }
    } catch (error) {
      alert('Error registering user:', error);
    }
  };

  return (
    <div className='loginmain'>
      <div className="loginform">
        <h2 className='title'>REGISTER FORM</h2>
        <div className="form">
          <form onSubmit={handleSubmit(onSubmit)}>
            <label className='name'>Username :</label><br />
            <input
              value={name}
              className='iname'
              placeholder='NAME'
              {...register("username", {
                required: 'Username is required',
                minLength: { value: 5, message: 'At least 5 characters are required' },
                pattern: { value: /^[a-zA-Z ]+$/, message: 'Only alphabets are allowed' },
              })}
            />
            {errors.username && <div>{errors.username.message}</div>}
            
            <label className='email'>Email :</label><br />
            <input
              className='ieml'
              placeholder='EMAIL'
              {...register("email", {
                required: 'Email is required',
                pattern: { 
                  value: /^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/,
                  message: 'Invalid email format',
                },
              })}
            />
            {errors.email && <div>{errors.email.message}</div>}
            
            <label className='pass'>Password :</label><br />
            <input
              className='ipass'
              placeholder='PASSWORD'
              type='password'
              {...register("password", {
                required: 'Password is required',
                minLength: { value: 8, message: 'Password must be at least 8 characters long' },
                pattern: { 
                  value: /^(?=.*[!@#$%^&*])/,
                  message: 'Password must contain at least one special character',
                },
              })}
            />
            {errors.password && <div>{errors.password.message}</div>}<br />
            
            <label className='conpass'>Confirm Password :</label><br />
            <input
              className='iconpass'
              placeholder='CONFIRM PASSWORD'
              type='password'
              {...register("confirmPassword", {
                required: 'Confirm Password is required',
                validate: value => value === password || 'Passwords do not match',
              })}
            />
            {errors.confirmPassword && <div>{errors.confirmPassword.message}</div>}<br></br>
            <center><button className='subbt' type="submit">Submit</button></center><br />
            </form>
            <center><p>Or</p></center>
            <center><button className='signup'  onClick={handleClick}  >Sign up</button></center>
          </div>
        </div>
      </div>
    );
  }
  
  export default App;
